import React from "react";
const Home = () => {
  return (
    <div>
      <h1>aditya & mishra</h1>
      {/* <button><a href="components\form\form">get started</a></button> */}
      <div class="header-cta">
       
        <a
          href="/form"
          class="n-btn-e n-btn-txt-icon btn-cta"
          data-nvt-action="cta_landing_build_resume"
        >
          <span>
            Build My Resume<span class="n-icon n-btn-icon-arrow-right"></span>
          </span>
        </a>
      </div>
    </div>
  );
};

export default Home;
